import getYouTubeID from "get-youtube-id";
import { useSelector } from "react-redux";
import YouTube from "react-youtube"

const Players = () => {
    const song = useSelector((state) => state.activeUrl.value)

    if(song.source === false){
    const opts = {
        height: '390',
        width: '640',
        playerVars: {
          // https://developers.google.com/youtube/player_parameters
          autoplay: 1,
        },
      };
    return(<div>
        <YouTube videoId={getYouTubeID(song.url)} opts={opts} />
        
        </div>)
    }else{

    // const validSpotifyUrl = new RegExp(
    //     '(?<=\/).{22}(?=\?)'
    //  );
    return(<div><iframe style={{borderRadius:"12px"}} src={"https://open.spotify.com/embed/track/" + song.url.match('(?<=\/).{22}(?=\?)') + "?utm_source=generator"} width="100%" height="380" frameBorder="0" allowFullScreen="" allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture"></iframe></div>)

    }
}
 export default Players
